import Nav from '..components/Nav'
import TinderCard from 'react-tinder-card'
import {useEffect, useState} from 'react'
import {useCookies} from 'react-cookie'
import ChatContainer from '../components/ChatContainer'
import axios from 'axios'
import CalculatedAge from '../components/CalculatedAge'

const Dashboard = () => {

    const [showModal, setShowModal] = useState(false)
    const [isSignUp, setIsSignUp] = useState(false)

    const authToken = cookies.AuthTokenconst [user, setUser] = useState(null)
    const [genderedUsers, setGenderedUsers] = useState(null)
    const [lastDirection, setLastDirection] = useState()
    const [cookies, setCookie, removeCookie] = useCookies(['user'])

    const userId = cookies.UserId

    const getUser = async () => {
        try {
            const response = await axios.get('http://localhost:8000/user', {
                params: {userId}
            })
            setUser(response.data)
        } catch (error) {
            console.log(error)
        }
    }

    const getGenderedUsers = async () => {
        try {
            const response = await axios.get('http://localhost:8000/gendered-users', {
                params: {gender: user?.gender_interest}
            })
            setGenderedUsers(response.data)
        } catch (error) {
            console.log(error)
        }
    }

    useEffect(() => {
        getUser()

    }, [])

    useEffect(() => {
        if (user) {
            getGenderedUsers()
        }
    }, [user])

    const updateMatches = async (matchedUserId) => {
        try {
            await axios.put('http://localhost:8000/addmatch', {
                userId,
                matchedUserId
            })
            getUser()
        } catch (error) {
            console.log(error)
        }
    }

    console.log(user)


/*    const characters = [
        {
            name: 'Richard Hendricks',
            url: 'https://i.imgur.com/adWO7ZG.jpg'
        },
        {
            name: 'Erlich Bachman',
            url: 'https://i.imgur.com/Da1kxC4.jpg'
        },
        {
            name: 'Monica Hall',
            url: 'https://i.imgur.com/SvTfxIA.jpg'
        },
        {
            name: 'Jared Dunn',
            url: 'https://i.imgur.com/vJisCu3.jpg'
        },
        {
            name: 'Dinesh Chugtai',
            url: 'https://i.imgur.com/PuFzzUI.jpg'
        }
    ]
*/


    const swiped = (direction, swipedUserId) => {
      if (direction === 'right') {
        updateMatches(swipedUserId)
      }
      setLastDirection(direction)
    }

    const outOfFrame = (name) => {
      console.log(name + ' left the screen!')
    }

    const matchedUserIds = user?.matches.map(({user_id}) => user_id).concat(userId)

    const filteredGenderedUsers = genderedUsers?.filter(genderedUser => !matchedUserIds.includes(genderedUser.user_id))



    return (
        <>
        <Nav 
        minimal={false} 
        authToken={authToken} 
        setShowModal={setShowModal} 
        showModal={showModal} 
        setIsSignUp={setIsSignUp}/>
        { user && 
            <div className="dashboard">
                <ChatContainer user={user}/>
                <div className="swipe-container">
                    <div className="card-container">
                        {filteredGenderedUsers?.map((genderedUser) =>
                            <TinderCard 
                                className="swipe" 
                                key={genderedUser.user_id} 
                                onSwipe={(dir) => swiped(dir, genderedUser.user_id)} 
                                onCardLeftScreen={() => outOfFrame(genderedUser.first_name)}>
                                <div 
                                    style={{ backgroundImage: 'url(' + genderedUser.url + ')' }} 
                                    className="card">
                                    <div className="card match-info">
                                    <h2>{genderedUser.first_name}, <CalculatedAge dob_year={genderedUser.dob_year} dob_month={genderedUser.dob_month} dob_day={genderedUser.dob_day} /></h2>
                                    <h3>"{genderedUser.about}"</h3>
                                    </div>
                                </div>
                            </TinderCard>
                        )}
                        <div className="swipe-info">
                            {lastDirection ? <p>You swiped {lastDirection}</p> : <p/>}
                        </div>
                    </div>
                </div>
            </div> }   
        </> 
    )
}

export default Dashboard
